$(".slide-hero").slick({
    infinite: !0,
    slidesToShow: 1,
    fade: !0,
    cssEase: "linear",
    autoplay: !0,
    autoplaySpeed: 3e3,
    arrows: !0,
    dots: !0,
    pauseOnHover: !1
}), $(".slide-dash").slick({
    dots: !0,
    arrows: !0,
    infinite: !0,
    speed: 300,
    slidesToShow: 4,
    slidesToScroll: 4,
    responsive: [ {
        breakpoint: 1024,
        settings: {
            slidesToShow: 4,
            slidesToScroll: 4,
            infinite: !0,
            dots: !0
        }
    }, {
        breakpoint: 800,
        settings: {
            slidesToShow: 3,
            slidesToScroll: 3
        }
    }, {
        breakpoint: 480,
        settings: {
            slidesToShow: 1,
            slidesToScroll: 1
        }
    } ]
}), $('a[href^="#"]').on("click", function(event) {
    var target = $($(this).attr("href"));
    target.length && (event.preventDefault(), $("html, body").animate({
        scrollTop: target.offset().top - 70
    }, 1e3));
}), $("#menu-show-mobile").click(function() {
    $(".menu").slideToggle("fast");
}), $(".fancybox").fancybox({
    openEffect: "none",
    closeEffect: "none"
}), $(document).foundation();